import React from 'react';

const Uri = () => {
  return (
    <div>
      <h1>Uri</h1>
      <p>
        Vivo en España desde hace 10 años y mi pasión por la fotografía nació
        porque aprecio sorprendemente la belleza especialmente la de la
        naturaleza, la ciudad; en fin, todo lo que hay a mi alrededor. Sin
        embargo, la música es la expresión máxima de la hermosura, en todo el
        sentido de la palabra.
      </p>
    </div>
  );
};

export default Uri;
